import React from 'react';
import './Rating.css';
import './Comments.css'

class Comments extends React.Component {
  render() {
    const { storage } = this.props;
    return (
      <div className="comment-box">
        <h1>Coment√°rios</h1>
        <div data-testid="product-detail-evaluation" className="comment">
          {storage && storage.map((e) => (
            <div >
              <p>
                Email:
                {e.email}
              </p>
              <p>
                Mensagem:
                {e.message}
              </p>
              <p>
                Nota:
                {e.value}
              </p>
            </div>
          ))}
        </div>
      </div>
    );
  }
}

export default Comments;
